import Button from 'react-bootstrap/Button';

function MalesBtn (props) {
    return (<div>
        <Button style={{width: "100%"}} variant="dark" onClick={props.filterMales}>Filter By Males!</Button>{' '}
    </div>)
}

export default MalesBtn;
